.traffic {
  background: #f0f3ff;
  width: 100%;
  height: 100%;
  overflow: hidden;
  padding: 15px;
  box-sizing: border-box;
}
.left1 {
  float: left;
  margin-left: 1%;
}
.top1 {
  width:49%;
  height:48.9%;
  background: rgba(255, 255, 255, 1);
  box-shadow: 0rem 0rem 1rem 0rem rgba(63, 106, 255, 0.08);
  border-radius: 0rem;
  margin-top: 0%;
  margin-left:-0.5px;
}
.bottom {
  width:49%;
  height:48.9%;
  background: rgba(255, 255, 255, 1);
  box-shadow: 0rem 0rem 1rem 0rem rgba(63, 106, 255, 0.08);
  border-radius: 0rem;
  margin-top: 1%;
  margin-left:-0.5px;
}
.right {
  float: right;
  margin-right: 1%;
}
/* 数据分析 */
.lefttop_header {
  height: 1rem;
  width: 100%;
  font-size: 0.8rem;
  text-indent: 10px;
  margin-top: 5px;
  font-family: PingFang SC;
  font-weight: 500;
  color: rgba(29, 33, 51, 1);
  line-height: 1rem;
  overflow: hidden;
}
.visiting {
  float: left;
  width: 28%;
  height: 50%;
  padding-top: 2rem;
  margin-left: 8%;
}
.visiting2 {
  float: left;
  width: 10rem;
  height: 10rem;
  margin-top: 3rem;
  border-radius: 100%;
  border: 10px solid #89A2FF;
  border-right: 10px solid #fff;
  transform:rotate(-45deg);
  margin-left: 20px;
}
.visiting2>div{
  transform:rotate(45deg);
  width: 100%;
  height: 100%;
  text-align: center;
  line-height: 400%;
}
.instrument {
  float: left;
  width: 100%;
  height: 100%;
}
/* 四个车位显示 */
.visiting div {
  width: 10rem;
  height: 5rem;
  font-size: 0.8rem;
  box-shadow: 0rem 0rem 1rem 0rem rgba(204, 204, 204, 0.2);
  border-radius: 0.5rem;
  padding-left: 2rem;
  font-family: PingFang SC;
  font-weight: 500;
  color: rgba(255, 255, 255, 1);
  line-height: 250%;
  margin-top: 0.5rem;
}
.visiting_div1 {
  background: linear-gradient(
    94deg,
    rgba(174, 197, 255, 1) 0%,
    rgba(139, 171, 253, 1) 100%
  );
}
.visiting_div2 {
  background: linear-gradient(
    94deg,
    rgba(174, 197, 255, 1) 0%,
    rgba(139, 171, 253, 1) 100%
  );
}
.liu{
  width: 100%;
  overflow: hidden;
  margin-top: 20px;
  padding-left: 10%;
}
.liu_top{
  width: 100%;
  overflow: hidden;
}
.liu_top>div{
  float: left;
  line-height: 30px;
  font-size: 15px;
  margin-right: 10px;
  height: 25px;
}
.liu_top div img{
  width: 30px;
  height: 30px;
}
.jin{
  width: 8px;
  height: 15px;
  background:rgba(228,229,255,1);
  opacity:0.5;
  border-radius:3px;
  margin-top: 7px;
  margin-left: 1px;
  float: left;
}
.you{
  width: 8px;
  height: 15px;
  background:rgba(162,188,255,1);
  border-radius:3px;
  margin-top: 7px;
  margin-left: 1px;
  float: left;
}
.liu_bottom{
  float: right;
  width: 76%;
}
